import React from "react";

import "./Background.css";

import reactJS from "../../images/backgroundCode/reactJS.png";
import html5 from "../../images/backgroundCode/html5.png";
import css from "../../images/backgroundCode/css.png";
import js from "../../images/backgroundCode/js.png";
import mongo from "../../images/backgroundCode/mongo.png";
import github from "../../images/backgroundCode/github.png";
import git from "../../images/backgroundCode/git.png";
import angular from "../..//images/backgroundCode/angular.png";

const Background = () => {
  return (
    <div className="Background row justify-content-center align-items-center p-3">
      <div className="row">
        <div className="col-6 col-lg-3">
          <img
            src={reactJS}
            alt="Imagen de logo ReactJS"
            className="img-fluid"
          />
        </div>
        <div className="col-6 col-lg-3">
          <img src={html5} alt="Imagen de logo ReactJS" className="img-fluid" />
        </div>
        <div className="col-6 col-lg-3">
          <img src={css} alt="Imagen de logo ReactJS" className="img-fluid" />
        </div>
        <div className="col-6 col-lg-3">
          <img src={js} alt="Imagen de logo ReactJS" className="img-fluid" />
        </div>
      </div>
      <div className="row">
        <div className="col-6 col-lg-3">
          <img src={mongo} alt="Imagen de logo ReactJS" className="img-fluid" />
        </div>
        <div className="col-6 col-lg-3">
          <img
            src={github}
            alt="Imagen de logo ReactJS"
            className="img-fluid"
          />
        </div>
        <div className="col-6 col-lg-3">
          <img src={git} alt="Imagen de logo ReactJS" className="img-fluid" />
        </div>
        <div className="col-6 col-lg-3">
          <img
            src={angular}
            alt="Imagen de logo ReactJS"
            className="img-fluid"
          />
        </div>
      </div>
    </div>
  );
};

export default Background;
